function nof () {
    if (fighterjet.overlapsWith(_1CM)) {
        f += 3
        sprites.destroy(_1CM)
    }
    if (fighterjet.overlapsWith(_2CM)) {
        f += 1
        sprites.destroy(_2CM)
    }
}
